import { HAIR, HAIR2, HAIR3, HAIR4, HAIR5 } from "../../images/images";
import { Navigation, Pagination, Scrollbar, A11y } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/swiper-bundle.css";
import "./Swaiper.css";
import "./Children.css";

function Children() {
  return (
    <section className="children">
      <div className="container">
        <div className="children__box">
          <Swiper
            modules={[Navigation, Pagination, Scrollbar, A11y]}
            pagination={{ clickable: true }}
            // navigation
            loop={true}
            spaceBetween={50}
            slidesPerView={4}
            onSlideChange={() => console.log("slide change")}
            onSwiper={(swiper) => console.log(swiper)}
          >
            <SwiperSlide>
              <img src={HAIR} alt="" />
            </SwiperSlide>
            <SwiperSlide>
              {" "}
              <img src={HAIR2} alt="" />
            </SwiperSlide>
            <SwiperSlide>
              {" "}
              <img src={HAIR3} alt="" />
            </SwiperSlide>
            <SwiperSlide>
              {" "}
              <img src={HAIR4} alt="" />
            </SwiperSlide>
            <SwiperSlide>
              {" "}
              <img src={HAIR5} alt="" />
            </SwiperSlide>
            ...
          </Swiper>
        </div>
      </div>
    </section>
  );
}
export default Children;
